import { Button, Card } from "@mantine/core";
import React, { useEffect } from "react";
import Home from "./home1";
import './Page.css';
import { useState } from "react";

function pending()
{
    return(
        <Card className="Cart_card">
            <p>
            <Button className="corner_button">+ ADD</Button>
                <table border={3} style={{marginTop:"40px",width:"1200px"}}>
                    <tr>
                        <td>Hello </td>
                    </tr>
                </table>
            </p>
        </Card>
    )
}

function Cart()
{ const [rel,setRel]=useState(pending())
     useEffect(()=>{
        setRel(pending())
     })
    return(
        <div>
            <Button className="Cart_Button">Bought</Button>
            <Button className="Cart_Button">Pending</Button>
            {rel};
        </div>
    )
}

export default Cart
